	add("geofence", "{\"term\":\"geofence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|geo|fence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A virtual perimeter around a geographic area. Geofences are typically enforced by monitoring the positions of trackable (e.g. GPS-equipped) devices inside or outside the fenced-in area, and determining if they cross the fence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"PetsMobility, in a document quoted in \u0027The Geopolitics of American Insecurity: Terror, Power and Foreign Policy\u0027 (François Debrix, Mark J. Lacy), page 101\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Establish a remote programmable \u0027\u0027geofence\u0027\u0027 around a yard or campus, and use handy notification features that alert your cell phone when a breach occurs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Chuck Martin, \u0027The Third Screen: Marketing to Your Customers in a World Gone Mobile\u0027, page 144\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027geofence\u0027\u0027 could be a mile or more around a store or it could be fifty feet from the front door, whatever the business decides\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Dan Burges, \u0027Cargo Theft, Loss Prevention, and Supply Chain Security\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It is recommended that the load be monitored actively or that alerts in the event of a \u0027\u0027geofence\u0027\u0027 break be sent to an offsite monitoring service in addition to the shipper\u0027s point of contact in order to expedite the escalation\", \"priority\":7}]}, \"synonyms\":{}}");

