	add("george", "{\"term\":\"george\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Name of an early saint, from Latin \u0027georgius\u0027 from Ancient greek (to 1453) \u0027γεώργιος\u0027 from \u0027γεωργός\u0027 (farmer)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1594\u0027\u0027 William Shakespeare: \u0027Richard III\u0027: Act V, Scene III\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Our ancient word of courage, fair Saint \u0027\u0027George\u0027\u0027, / Inspire us with the spleen of fiery dragons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1830\u0027\u0027 , \u0027Our Village: Fourth Series: Cottage Names\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"George\u0027\u0027 and Charles are unlucky in this respect; they have no diminutives, and what a mouthful of monosyllables they are! names royal too, and therefore unshortened. A king must be of a very rare class who could afford to be called by shorthand\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027 , \u0027Nursery School\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"George\u0027\u0027... don\u0027t do that\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"or Georgia; also used in the conjoined name George Ann(e\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1942\u0027\u0027 , \u0027, Brockhampton Press (1974), ISBN 0340174927, page 18\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"No,\u0027 she said, \u0027I\u0027m not Georgina.\u0027 \u0027Oh!\u0027 said Anne, in surprise. \u0027Then who are you?\u0027 \u0027I\u0027m \u0027\u0027George\u0027\u0027,\u0027 said the girl. \u0027I shall only answer if you call me \u0027\u0027George\u0027\u0027. I hate being a girl\", \"priority\":9}]}, \"synonyms\":{}}");

